    const fetchPublicInfo = async () => {
        try {
            const response = await api({
                method: 'get',
                url: '/user_public'
            })
            console.log(response.data)
        } catch(e) {
            console.log(e)
        } finally {
            setLoading(false)
        }
    }

    useEffect(() => {
        fetchPublicInfo()

